import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import { FaGithub, FaLinkedin } from 'react-icons/fa';

function Footer() {
  return (
    <Container fluid className="bg-dark text-white py-3">
      <Row>
        <Col xs={12} md={6}>
          <p>Connect with me on social media:</p>
        </Col>
        <Col xs={12} md={6}>
          <div className="d-flex justify-content-end">
            <a href="https://github.com/yourusername" target="_blank" rel="noopener noreferrer" className="text-white mx-3">
              <FaGithub size={24} />
            </a>
            <a href="https://www.linkedin.com/in/yourname/" target="_blank" rel="noopener noreferrer" className="text-white mx-3">
              <FaLinkedin size={24} />
            </a>
          </div>
        </Col>
      </Row>
    </Container>
  );
}

export default Footer;
